    return(
        <>
 <div className="header up1" style={{position:'sticky'}} >
 {/* <img className="mx_img" src={require( './images/bk.jpg')} alt="" /> */}
      <nav className="navbar up" style={{position:'sticky'}}>
        <div >
        <img src={require('./images/pic.jpg')}  width='50px' height='50px'/>
        </div>
        <h1 className="head1" >ASHOK A</h1>
        <ul className="navbar--items ulSt">
          <li className="navbar--1">
            <a href="./index.html">Home</a>
          </li>
          <li className="navbar--1">
            <a href="#">About</a>
          </li>
          <li className="navbar--1">
            <a href="#">Contact</a>
          </li>
          
        </ul>
        <div className="search" >
          <input className="search--tbox" type="text" />
          <button className="search--btn">
            <img src= {img1} alt="" className='oneim' />
          </button>
        </div>
      </nav>
      
      
      </div>             
      
      <div  className="up1">
        <pre>
      <div className="topDet">
        <div >
        <br/><br/><br/>
        <h1>                           Name:     ASHOK A</h1><br/><br/>
        <h1>                           Mail Id:     ashokarunachalam333@gmail.com</h1><br/><br/>
        <h1>                           Mobile Number:   9486444911</h1><br/><br/>
        </div>
      </div>
      </pre>
      <hr/>
      <div>
        <br/>
        <div className="topDet2">
      <h1 >Upload Vehicle:-</h1>
      </div>
      
      <br/><br/><br/>
      <div className="topDet3">
        <form onSubmit={sendData} encType="multipart/form-data">
        <input className="ip1" required type="text" name="vehicleName" value={vehicleName} onChange={handleChange} placeholder="Name of the Vehicle*"></input> 
        <input className="ip2" required type="text" name="modelNo" value={modelNo} onChange={handleChange} placeholder="Model of the Vehicle*"></input> 
         <input className="ip3" required type="file" name="picDict" onChange={change} /><br/><br/> 
        <button className="ip4"type='submit'>Upload</button>
        </form>
      </div>
      <br/><br/><br/>
      <br/>
      <br/>
      </div>
      <hr/>
      <div className='album'>
        <br/><br/><br/>
        <h1 className="yourVehi" style={{color:'black'}}> YOUR VEHICLES:-</h1>
        {picname.map(({imgName,_id})=>
          <React.Fragment key={_id}>
          <h1 style={{color:'white'}}>{imgName}</h1>
          <h1 style={{color:"white"}}>{_id}</h1>
          </React.Fragment>
        )}
      
      </div>
      </div>
        </>
    );
}
